import React from 'react';

function PortfolioCard(props) {
  return (
    <div className="PortfolioCard">
      <img className="" src={props.mainImg} alt="main_img" />
      <p>{props.school}</p>
      <p>{props.major}</p>
      <p>
        {props.userName}
        <span>{props.year}</span>
      </p>
    </div>
  );
}

export default PortfolioCard;
